INSERT INTO announcement VALUES (1, 'OPM''s USAJOBS is proud to announce the launch of Acquisition Open Opportunities.', 0, '2019-06-24 08:35:46.481-04', '2019-06-24 08:35:46.481-04', '<p>We’ve partnered with OMB’s Office of Federal Procurement Policy (OFPP) and the Federal Acquisition Institute to launch the new <a href="/tasks?career=Acquisition">Acquisition Open Opportunities</a> portal. You can now search for opportunities within the Acquisitions career field. <a href="https://youtu.be/6qdmmeB9yIc" target="_blank">Check out this video<i class="fas fa-external-link-alt"></i></a> from Lesley Field, Deputy Administrator of OFPP to learn more.</p> <img class="img-responsive" src="/images/home/landing_acquisition.png" alt="Acquisition screenshot">');
