INSERT INTO community VALUES (2, 'DHS Joint Duty Program', 91, 'Kenneth Johnson', 'JointDutyProgramOffice@hq.dhs.gov', 'The Department of Homeland Security Joint Duty Program is an intra- and inter-departmental program that offers civilian personnel professional and developmental opportunities.  Joint duty assignments enhance operations and mission execution through unity of effort and collaboration.  The program covers Federal employees at the GS-13 through GS-15 grade levels and equivalent.', 1, true, 2, 1, 'JointDutyProgramOffice', 'JointDutyProgramOffice@hq.dhs.gov', '2019-10-10 11:11:19.331-04', '2019-10-10 11:11:19.331-04', NULL, NULL, '', NULL, '/img/community-logo/png/dhs.png', false, NULL);
INSERT INTO community VALUES (3, 'U.S. Department of State Student Internship Program (Unpaid)', 4, 'Student Internship Program Office', 'studentinternship@state.gov', 'The U.S. Department of State Student Internship Program is an unpaid internship with the opportunity to work in U.S. embassies and consulates throughout the world, as well as in various bureaus located in Washington, D.C. and at Department offices around the United States. This program is designed to provide substantive learning experiences in a foreign affairs environment.', 2, true, 2, 2, 'https://careers.state.gov/intern/student-internships/', 'studentinternship@state.gov', '2019-10-10 11:11:19.432-04', '2019-10-10 11:11:19.432-04', NULL, NULL, 'dos', 'Student Internship Program (Unpaid)', NULL, false, 'dos');
INSERT INTO community VALUES (4, 'Virtual Student Federal Service (VSFS)', 4, 'Virtual Student Program Office', 'studentinternship@state.gov', 'The Virtual Student Federal Service (VSFS) is the largest virtual internship in the world. Led by the U.S. Department of State, VSFS opens the doors of government to the excellence and energy of U.S. citizen students. Working from college and university campuses in the United States and throughout the world, eInterns are partnered with more than 60 federal agencies and U.S. diplomatic posts overseas.', 2, true, 2, 2, 'https://vsfs.state.gov', 'studentinternship@state.gov', '2019-10-10 11:12:36.109-04', '2019-10-10 11:12:36.109-04', NULL, NULL, '', NULL, NULL, true, 'vsfs');
