INSERT INTO phase VALUES (3, 'Close phase', 'The close cycle phase will end the applicant review process and hiring managers will no longer be able to move or select interns. We''ll send emails to the students who''ve been selected as primaries and alternates to explain next steps, and to students who were not selected for an internship.<br /> We''ll also move all review boards from the <b>Active</b> list to the <b>Archived</b> list. You can still access the archived review boards for historical purposes.', 3, '{"modal_text": "Are you sure you want to close the cycle? Hiring managers will not be able to make selections once the cycle is closed. Emails will go to all applicants to inform them of their status and we''ll archive all review boards. Once review boards are archived, they can''t be reopened.", "button_name": "Close cycle", "modal_header": "Confirm Close cycle.", "confirm_action": "closeCycle"}');
INSERT INTO phase VALUES (1, 'Primary phase', 'During this phase, hiring managers review the applicants for their internship opportunity, send emails to schedule interviews and make their primary selections.', 1, '{"modal_text": "Are you sure you want to start <strong>primary phase</strong>? Hiring managers will be able to view and interact with students on their boards. This action cannot be undone.", "button_name": "Start primary phase", "alert_header": "You have successfully started the primary phase.", "modal_header": "Confirm start primary phase.", "confirm_action": "startPrimaryPhase"}');
INSERT INTO phase VALUES (2, 'Alternate phase', 'During this phase hiring managers will continue to review applicants for their internship opportunity and make their alternate selections.  If they haven’t filled all of their primary slots, they can also complete their primary selections. <br /><br />It may take up to 10 minutes for the boards to repopulate for the alternate phase. Once the boards are ready, you’ll see a success banner at the top of the screen.', 2, '{"modal_text": "Are you sure you want to start the alternate phase? Once you start the alternate phase you can''t end it without closing the entire cycle.", "button_name": "Start alternate phase", "alert_header": "You have successfully started the alternate phase.", "modal_header": "Confirm start alternate phase.", "confirm_action": "startAlternatePhase"}');
